function Collect() {
  async function load() {
    let url = 'https://my-json-server.typicode.com/typicode/demo/db';
    let obj = await (await fetch(url)).json();
    console.log(obj);
}
  return (
    <div className="App">
      load()
    </div>
  );
}

export default Collect;
